const Rating = ({rate}) => {

  if(rate === 5){
    return (
      <span className="rating-stars">                          
          <i className="ti-star full"></i>
          <i className="ti-star full"></i>
          <i className="ti-star full"></i>
          <i className="ti-star full"></i>
          <i className="ti-star"></i>
      </span>
    )}
    else if(rate === 4){
      return (
        <span className="rating-stars">                          
            <i className="ti-star full"></i>
            <i className="ti-star full"></i>
            <i className="ti-star full"></i>
            <i className="ti-star full"></i>
            <i className="ti-star"></i>
        </span>
      )
    }
  }


export default Rating
